import React from 'react'

import Navbar from './Navbar'
import Header from './Header'
import styles from './Layout.module.css'

const Layout = (props) => {
  return (
    <div className={styles.container}>
        <Navbar/>
        <Header/>
        {props.children}</div>
  )
}

export default Layout
